				<a href="#" class="prof_block_h2">Доктор</a>
				<p>Где работать</p>
				<span>универсальность профессии врача заключается в том, что он может найти работу практически везде — от фельдшерского пункта на селе до частной клиники в мегаполисе.</span>
				<p>ГДЕ УЧИТЬСЯ</p>
				<span>
					Чтобы стать практикующим врачом, теперь достаточно шесть лет отучиться в вузе: практика будет еще в институте, а специализация появится на 6 курсе. Диплома достаточно, чтобы работать врачом общей практики в поликлинике или районной больнице. И все же для получения сертификата, дающего право врачебной практики по наиболее сложным и узким специальностям по-прежнему необходима двухлетняя ординатура.
				</span>
